import React from 'react';

class Menu extends React.Component{
    render(){
        return(<nav className="navbar">
        <ul >
          <li className="active"><a href="#">Task 1</a></li>
          <li><a href="/other">Task 2</a></li>
          <li><a href="#">Task 3</a></li>
          <li><a href="#">Task 4</a></li>
        </ul>
     </nav>);
    }
}
